Jimmy's old neighborhood has fallen on hard times after the Grimaldi Gang took over the town. There's only one way to save the city. You must beat the Grimaldis in a slew of challenging poker matches. Are you ready for an incredible adventure?

Rid the treasured hometown of the menacing Grimaldi Gang.
Earn money to buy back buildings.
Regain control of all 11 neighborhoods in Shipsburgh.
Play a slew of challenging poker matches.
Time management fun! collect money and buy buildings to increase your earnings
